import React, {useState} from 'react'
import {Link, Route, BrowserRouter as Router, Switch} from 'react-router-dom'
import Spinner from 'react-bootstrap/Spinner'
import Button from 'react-bootstrap/Button'
import Data from './Data'
import {Modal} from 'react-bootstrap'



const User = ({loader,data}) =>{

    const [modalShow, setModalShow] = useState(false);
    // const newUser = () =>{
    //     console.log('clicked')
    // }

    
    // Add new User
    return (
        <>
         <nav><h1>User</h1>
         <ul><li>About</li><li>Contact</li></ul>
         <Button  variant="primary" onClick={() => setModalShow(true)}>Add a user</Button>
         </nav>

         {!loader ? <Spinner animation="grow" /> : <div className = "user-table"><h1>Homepage</h1><Data data = {data}/> </div>  } 

         <Modal show = {modalShow} class="modal-dialog modal-dialog-centered" >
             <Modal.Header>Hello</Modal.Header>
             
             <Modal.Body>Body</Modal.Body>
             <Button  variant="primary" onClick={() => setModalShow(false)}>Add a user</Button>
         </Modal>
        
         
        
        </>
    )
}

export default User;
